startdateformat:
function handle(eventDate){
	var eventDateTemp = eventDate;
    var returnObj = {
        valDate : '',
        format : 'MMM dd yyyy'
    };
	if(eventDateTemp.indexOf('-') > 0){
		eventDateTemp = eventDateTemp.split('-')[0]
        eventDateTemp = eventDateTemp + ' ' + new Date().getFullYear()

	} 
	else{
        if(eventDateTemp.trim().length > 2){
        eventDateTemp = eventDateTemp + ' ' + new Date().getFullYear()
        }else{
            eventDateTemp = new Date().getMonth() + ' ' + new Date().getDate() + ' ' + new Date().getFullYear();
        }
	}
    returnObj.valDate = eventDateTemp;
    return returnObj;
}

